import React from 'react';
import { useState } from 'react';
import Contentarea from './Contentarea';
let count = 0;
const Rewardscount = () => {
    const state = useState();
    const [count, setCount] = useState(0);
    const GuideMe = () => { 
        setCount(5);
        var element = document.getElementById("guideBox");
        element.classList.add("ShowGuide");    
        var elements = document.getElementById("Leadership");
        elements.classList.add('Zindex');     
    }
    return (
        <small className="Recount">{count}</small>
    );
}

export default Rewardscount;
